import React from 'react';
import Link from 'next/link';

class Index extends React.Component {
    render(){
        return(
            <React.Fragment>
                <h1>I am from Index Page!</h1>
                <Link href="/about">
                    <a >Home</a>
                </Link>
                <Link href="/">
                    <a >Home</a>
                </Link>
                <Link href="/">
                    <a >Home</a>
                </Link>
                <Link href="/">
                    <a >Home</a>
                </Link>
                
                <a href="/">About</a>
                <a href="/portfolios">Portfolio</a>
                <a href="/blogs">Blog</a>
                <a href="/cv">CV</a>
            </React.Fragment>
        );
    }
}

export default Index;
